import 'dart:convert';

class Data {
	int? id;
	String? name;
	String? email;
	dynamic emailVerifiedAt;
	String? phone;
	dynamic verificationCode;
	String? fcmToken;
	int? roleId;
	String? createdAt;
	String? updatedAt;

	Data({
		this.id, 
		this.name, 
		this.email, 
		this.emailVerifiedAt, 
		this.phone, 
		this.verificationCode, 
		this.fcmToken, 
		this.roleId, 
		this.createdAt, 
		this.updatedAt, 
	});

	factory Data.(Map<String, dynamic> data) {
		return Data(
			id: data['id'] as int?,
			name: data['name'] as String?,
			email: data['email'] as String?,
			emailVerifiedAt: data['email_verified_at'] as dynamic,
			phone: data['phone'] as String?,
			verificationCode: data['verification_code'] as dynamic,
			fcmToken: data['fcm_token'] as String?,
			roleId: data['role_id'] as int?,
			createdAt:data['created_at'] as String,
			updatedAt: data['updated_at'] as String,
		);
	}



	Map<String, dynamic> () {
		return {
			'id': id,
			'name': name,
			'email': email,
			'email_verified_at': emailVerifiedAt,
			'phone': phone,
			'verification_code': verificationCode,
			'fcm_token': fcmToken,
			'role_id': roleId,
			'created_at': createdAt,
			'updated_at': updatedAt,		};
	}

  /// `dart:convert`
  ///
  /// Parses the string and returns the resulting Json object as [Data].
	factory Data.fromJson(String data) {
		return Data.(json.decode(data) as Map<String, dynamic>);
	}
  /// `dart:convert`
  ///
  /// Converts [Data] to a JSON string.
	String toJson() => json.encode(());
}
